    public updateVehicle(
        dt: number,
        filterFlags?: QueryFilterFlags,
        filterGroups?: InteractionGroups,
        filterPredicate?: (collider: Collider) => boolean,
    ) {
        this.raw.update_vehicle(
            dt,
            this.bodies.raw,
            this.colliders.raw,
            this.queries.raw,
            filterFlags,
            filterGroups,
            this.colliders.castClosure(filterPredicate),
        );
    }

